import React from 'react'
import Link from 'next/link'

function Nav() {
    return (
        <div>
            <nav>
                <ul style={{ background: "black" }}>
                    <li >
                        <Link href="/">
                            <a>Home</a>
                        </Link>
                    </li>
                    <li>
                        <Link href="/Competition">
                            <a>Compotition</a>
                        </Link>
                    </li>
                    <li>
                        <Link href="/Create">
                            <a>Create Competition</a>
                        </Link>
                    </li>

                </ul>
            </nav>
            <style jsx>
                {`
                    ul{
                        list-style: none;
                        display: flex
                    }
                    li{
                        margin : 10px;
                        color : "white"
                        
                    }
                `}
            </style>
        </div>

    )
}





export default Nav;
